            "bisqEasy.mediation.request.confirm.openMediation" to "Mediation öffnen",
            "bisqEasy.price.tradePrice.inputBoxText" to "Handelspreis in {0}",
            "bisqEasy.tradeGuide.rules.content" to "- Vor dem Austausch von Kontodaten zwischen dem Verkäufer und dem Käufer kann jede Partei den Handel ohne Angabe von Gründen abbrechen.\n- Händler sollten ihre Transaktionen regelmäßig auf neue Nachrichten überprüfen und müssen innerhalb von 24 Stunden antworten.\n- Sobald Kontodaten ausgetauscht werden, wird das Nichterfüllen der Handelsverpflichtungen als Vertragsbruch angesehen und kann zu einem Ausschluss aus dem Bisq-Netzwerk führen. Dies gilt nicht, wenn der Handelspartner nicht reagiert.\n- Während der Fiat-Zahlung DARF der Käufer keine Begriffe wie 'Bisq' oder 'Bitcoin' im Feld 'Zahlungsgrund' angeben. Stattdessen sollte die Handels-ID als Grund verwendet werden, um die Banküberweisung mit dem Handel zu verknüpfen.\n- Wenn der Handel aufgrund längerer Fiat-Überweisungszeiten nicht sofort abgeschlossen werden kann, müssen beide Händler mindestens einmal täglich online sein, um den Handelsfortschritt zu überwachen.\n- Sollten Händler auf ungelöste Probleme stoßen, haben sie die Möglichkeit, einen Mediator in den Handels-Chat einzuladen, um Unterstützung zu erhalten.\n\nWenn Sie Fragen haben oder Hilfe benötigen, zögern Sie nicht, die Chaträume im Menü 'Support' zu besuchen. Viel Spaß beim Handel!",
