            "bisqEasy.tradeCompleted.info" to "Wir hoffen, dass Ihre Erfahrung reibungslos und angenehm war. Wir würden uns freuen, Ihre Gedanken zu hören!\nDas Teilen Ihrer Eindrücke im Diskussions-Chat hilft dem Bisq-Team, Bisq Easy zu verbessern.",
            "bisqEasy.tradeState.info.buyer.phase2a.accountDataBanned.popup.warning" to "Die Kontodaten des Verkäufers wurden aufgrund betrügerischer Aktivitäten gesperrt.\n\nBitte senden Sie kein Geld an dieses Konto!\n\nDer Teilnehmer wurde dem Moderator gemeldet und wird bald aus dem Netzwerk gesperrt.\n\nZu Ihrem Schutz wurde dieser Handel als storniert markiert. Sie können den Handel jetzt sicher schließen.\n\nWenn Sie Fragen haben oder weitere Unterstützung benötigen, besuchen Sie bitte den Support-Chat.",
            "bisqEasy.tradeState.info.seller.phase3a.baseAmount" to "Zu sendender Betrag",
            "bisqEasy.takeOffer.review.takeOfferSuccess.subTitle" to "Bitte setzen Sie sich mit dem Handelspartner unter 'Offene Transaktionen' in Verbindung.\nDort finden Sie weitere Informationen für die nächsten Schritte.\n\nÜberprüfe die Bisq-Anwendung regelmäßig auf neue Nachrichten von einem Handelspartner.",
            "bisqEasy.tradeState.info.seller.phase3a.tradeLogMessage.paymentProof.LN" to "Preimage",
            "bisqEasy.tradeCompleted.body.txId.tooltip" to "Öffnen Sie den Block-Explorer für die Transaktion",
            "bisqEasy.offerbook.marketListCell.numOffers.many" to "{0} Angebote",
            "bisqEasy.tradeState.info.buyer.phase2a.paymentReason" to "Grund für die Zahlung",
            "bisqEasy.walletGuide.createWallet.content" to "Bluewallet ermöglicht es dir, mehrere Wallets für verschiedene Zwecke zu erstellen. Für den Anfang benötigst du nur eine Wallet. Wenn du Bluewallet öffnest, wirst du aufgefordert, eine neue Wallet hinzuzufügen. Gib einen Namen für deine Wallet ein und wähle unter 'Typ' die Option *Bitcoin*. Du kannst alle anderen Optionen so belassen, wie sie erscheinen, und auf *Erstellen* klicken.\n\nIm nächsten Schritt werden dir 12 Wörter angezeigt. Diese 12 Wörter sind das Backup, mit dem du deine Wallet wiederherstellen kannst, wenn etwas mit deinem Telefon passiert. Schreibe sie in der gleichen Reihenfolge auf ein Blatt Papier (nicht digital), bewahre dieses Papier sicher auf und stelle sicher, dass nur du Zugriff darauf hast. Du kannst mehr darüber lesen, wie du deine Wallet sichern kannst, in den Lernabschnitten von Bisq Easy, die Wallets und Sicherheit gewidmet sind.\n\nWenn du fertig bist, klicke auf 'Okay, ich habe es aufgeschrieben'.\nHerzlichen Glückwunsch! Du hast deine Wallet erstellt! Lass uns nun weitergehen, wie du deinen Bitcoin darin empfangen kannst.",
            "bisqEasy.tradeCompleted.body.tradeFee.value" to "Keine Handelsgebühren",
            "bisqEasy.walletGuide.download.content" to "Es gibt viele Wallets, die Sie verwenden können. In diesem Leitfaden zeigen wir Ihnen, wie Sie Bluewallet verwenden. Bluewallet ist großartig und gleichzeitig sehr einfach, und Sie können es verwenden, um Ihre Bitcoin von Bisq Easy zu empfangen.\n\nSie können Bluewallet auf Ihrem Handy herunterladen, unabhängig davon, ob Sie ein Android- oder iOS-Gerät haben. Besuchen Sie dazu die offizielle Webseite unter 'bluewallet.io'. Sobald Sie dort sind, klicken Sie auf App Store oder Google Play, je nachdem, welches Gerät Sie verwenden.\n\nWichtiger Hinweis: Zu Ihrer Sicherheit stellen Sie sicher, dass Sie die App aus dem offiziellen App Store Ihres Geräts herunterladen. Die offizielle App wird von 'Bluewallet Services, S.R.L.' bereitgestellt, und Sie sollten dies in Ihrem App Store sehen können. Das Herunterladen einer bösartigen Wallet könnte Ihre Gelder gefährden.\n\nAbschließend ein kurzer Hinweis: Bisq ist in keiner Weise mit Bluewallet verbunden. Wir empfehlen die Verwendung von Bluewallet aufgrund seiner Qualität und Einfachheit, aber es gibt viele andere Optionen auf dem Markt. Sie sollten sich absolut frei fühlen, zu vergleichen, auszuprobieren und die Wallet zu wählen, die am besten zu Ihren Bedürfnissen passt.",
