            "reputation.reputationScore.intro" to "In diesem Abschnitt wird die Bisq Reputation erklärt, damit Sie informierte Entscheidungen beim Annehmen eines Angebots treffen können.",
            "user.bondedRoles.registration.bondHolderName" to "Nutzername des Bond-Inhabers",
            "user.bondedRoles.type.SEED_NODE.about.info" to "Ein Seed-Knoten stellt Netzwerkadressen von Netzwerkteilnehmern für das Bootstrapping des Bisq Easy-P2P-Netzwerks bereit.\nDies ist besonders wichtig beim allerersten Start, da zu diesem Zeitpunkt der neue Benutzer noch keine persistierten Daten für die Verbindung zu anderen Peers hat.\nEr stellt auch P2P-Netzwerkdienste wie Chat-Nachrichten für den neu verbindenden Benutzer bereit.\nDieser Datenbereitstellungsdienst wird jedoch auch von jedem anderen Netzwerkknoten durchgeführt, aber da Seed-Knoten rund um die Uhr verfügbar sind und einen hohen Qualitätsstandard bieten, bieten sie mehr Stabilität und bessere Leistung, was zu einer besseren Start-Experience führt.\nSeed-Knoten-Betreiber von Bisq 1 können ohne Aufnahme einer neuen BSQ-Bindung zu Bisq Easy-Seed-Knoten-Betreibern werden.",
