            "user.bondedRoles.type.MARKET_PRICE_NODE" to "Marktpreis-Knoten",
            "reputation.bond.info2" to "Die Sperrzeit muss mindestens 50 000 Blöcke betragen, was etwa einem Jahr entspricht, um als gültiger Bond betrachtet zu werden. Die Menge kann vom Benutzer gewählt werden und bestimmt zusammen mit der Sperrzeit das Ranking gegenüber anderen Verkäufern. Verkäufer mit der höchsten Reputation haben bessere Handelsmöglichkeiten und können einen höheren Preis erzielen. Die Top 3 Angebote nach Reputation werden im Bildschirm 'Bitcoin kaufen' beworben.\n\nMengen unter 1000 BSQ bieten möglicherweise nicht das erforderliche Mindestmaß an Sicherheit, um das Vertrauen eines Käufers aufzubauen (abhängig vom Markt und den gehandelten Mengen).\n\nWenn ein BSQ-Bond zu umständlich ist, erwäge die anderen verfügbaren Optionen zum Aufbau der Reputation.",
            "reputation.accountAge.info2" to "Das Verknüpfen deines Bisq-1-Kontos mit Bisq Easy hat einige Auswirkungen auf deine Privatsphäre. Um das Alter deines  Kontos zu überprüfen, wird deine Bisq-1-Identität kryptografisch mit deiner Bisq-2-Profil-ID verknüpft.\nDie Exposition ist jedoch auf den 'Bisq-1-Bridge-Knoten' beschränkt, der von einem Bisq-Mitwirkenden betrieben wird, der einen BSQ-Bond hinterlegt hat.\n\nDas Alter eines Kontos ist eine Alternative für diejenigen, die wegen der finanziellen Kosten kein entwertetes BSQ oder BSQ-Bonds verwenden möchten. Das Konto sollte mindestens mehrere Monate alt sein, um ein gewisses Maß an Vertrauen widerzuspiegeln.",
            "reputation.signedWitness.score.headline" to "Auswirkung auf die Reputation",
