            "user.bondedRoles.type.MODERATOR.about.info" to "Chat-Benutzer können Verstöße gegen die Chat- oder Handelsregeln an den Moderator melden.\nFalls die bereitgestellten Informationen ausreichen, um einen Regelverstoß zu überprüfen, kann der Moderator den Benutzer vom Netzwerk ausschließen.\nBei schwerwiegenden Verstößen eines Verkäufers, der eine gewissen Reputation erlangt hatte, wird die Reputation ungültig, und die relevanten Quelldaten (wie die DAO-Transaktion oder das Alter des Kontos) werden in Bisq Easy auf die schwarze Liste gesetzt und vom Orakelbetreiber an Bisq 1 zurückgemeldet. Der Benutzer wird auch bei Bisq 1 gesperrt.",
            "reputation.source.PROFILE_AGE" to "Profilalter",
            "reputation.bond.howTo" to "1. Wähle das Benutzerprofil aus, für das du die Reputation anhängen möchtest.\n2. Kopiere die 'Profil-ID'\n3. Öffne Bisq 1 und gehe zu 'DAO/KOPPLUNG/GEKOPPELTES ANSEHEN' und füge den kopierten Wert in das Feld 'Salt' ein.\n4. Gib die Menge an BSQ ein, die du sperren möchtest, und die Sperrzeit (min. 50 000 Blöcke) an.\n5. Veröffentliche die Sperrtransaktion.\n6. Nach der Bestätigung durch die Blockchain wird deine Reputation in deinem Profil sichtbar.",
